import FormSubmitButton from "./FormSubmitButton"

export const ClosePopup = () => {
  return (
    <PopupWithForm text="Вы уверены?" name="delete">
      <FormSubmitButton text="Да"/>
    </PopupWithForm>
  )
}

export default ClosePopup
